sys_variable_value.value:
(function execute(inputs, outputs) {
	if(inputs.status_code == "200"){
    	var responseObj = JSON.parse(inputs.response_body);
      	outputs.hostname = responseObj.hostname;
		outputs.country = responseObj.country;
		outputs.region = responseObj.region;
		outputs.city = responseObj.city;

      	var loc = responseObj.loc.split(",");
      	outputs.latitude = loc[0];
      	outputs.longitude = loc[1];
    }
})(inputs, outputs);

